QUnit.module('URIBuilder Test', {
  before: function() {
    init();
  }
});


/**
 * sdk.URIBuilderのテストを行うクラス。
 * 実用的なテストは、各デバイスプラグインで行うため、こちらでは割愛する。
 *
 * @class
 */
let URIBuilderTest = {};

/**
 * sdk.URIBuildeのオブジェクトを作成するテストを行う。
 * <p id="test">
 * let builder = new sdk.URIBuilder();
 * </p>
 * <h3>【期待する動作】</h3>
 * <p id="expected">
 * ・buildeがnullではないこと。<br/>
 * </p>
 */
URIBuilderTest.normalTest001 = function(assert) {
  let done = assert.async();
  let builder = new sdk.URIBuilder();
  assert.notEqual (builder, null, 'Create builder object.');
  done();
};
QUnit.test('Create', URIBuilderTest.normalTest001);

/**
 * /profile/interface/attributが設定した値になっていることを確認する
 * テストを行う。
 * <p id="test">
 *  Path:  /gotapi/profile/interface/attribute
 * </p>
 * <h3>【期待する動作】</h3>
 * <p id="expected">
 * ・/profile/interface/attributが設定した値になっていること。<br/>
 * </p>
 */
URIBuilderTest.normalTest002 = function(assert) {
  let done = assert.async();
  let builder = new sdk.URIBuilder();
  builder.setProfile('profile');
  builder.setInterface('interface');
  builder.setAttribute('attribute');
  let profile = builder.getProfile();
  let interface = builder.getInterface();
  let attribute = builder.getAttribute();
  assert.equal (profile, 'profile', 'profile=' + profile);
  assert.equal (interface, 'interface', 'interface=' + interface);
  assert.equal (attribute, 'attribute', 'attribute=' + attribute);
  done();
};
QUnit.test('Setter', URIBuilderTest.normalTest002);


/**
 * URIが作成されることを確認するテストを行う。
 * <p id="test">
 *  Path:  /gotapi/profile/interface/attribute
 * </p>
 * <h3>【期待する動作】</h3>
 * <p id="expected">
 * ・URIがnullではないこと。<br/>
 * </p>
 */
URIBuilderTest.normalTest003 = function(assert) {
  let done = assert.async();
  let builder = new sdk.URIBuilder();
  builder.setProfile('profile');
  builder.setInterface('interface');
  builder.setAttribute('attribute');
  let uri = builder.build();
  assert.notEqual (uri, null, 'Create uri.');
  done();
};

QUnit.test('build', URIBuilderTest.normalTest003);


